DROP TABLE IF EXISTS `sys_code`;
CREATE TABLE `sys_code` (
  `ID` bigint(16) NOT NULL COMMENT '上级代码',
  `CODE` varchar(12) NOT NULL,
  `NAME` varchar(200) NOT NULL COMMENT '名称',
  `PID` decimal(16,0) NOT NULL COMMENT '上级代码',
  `FILTER_BASIN` varchar(20) DEFAULT NULL COMMENT '业务特性过滤:将某类业务不可能出现的某类字典数据项过滤掉，以免业务人员错选，使系统更人性化\n如：10000000  目前只用前两位\n第一位国内字典，第二位涉外字典，',
  `REGION_DEPTH` decimal(2,0) DEFAULT NULL COMMENT '行政区级别深度:是隐含字段，由系统决定，不能随意修改',
  `LEVEL_CODE` decimal(16,0) DEFAULT NULL COMMENT '行政级别：',
  `SHORT_NAME` varchar(10) DEFAULT NULL COMMENT '简称简称',
  `SORT_NO` varchar(30) DEFAULT NULL COMMENT '排序码:以3位进行分级',
  `STATE_CODE` varchar(30) DEFAULT NULL COMMENT '国标代码',
  `ALPHA_CODE` varchar(10) DEFAULT NULL COMMENT '字母码',
  `MODIFY_MAN` decimal(16,0) DEFAULT NULL COMMENT '修改人',
  `MODIFY_DATE` datetime DEFAULT NULL COMMENT '修改日期',
  `DEPLOY_FLAG` decimal(1,0) DEFAULT NULL COMMENT '部署标志:1-部署节点，0-普通节点',
  `ENTITY_FLAG` decimal(1,0) DEFAULT NULL COMMENT '实体标志:1-实体行政区，0-虚设行政区，主要用于行政区的选择，存在有实际编制的行政区',
  `LINEAL_FLAG` decimal(1,0) DEFAULT NULL COMMENT '直辖标志:1-直辖行政区，0-非直辖行政区，主要用于行政区不在同一级别上，直接由上级的上级管理',
  `VALID_FLAG` decimal(1,0) DEFAULT NULL COMMENT '有效标志：0-无效，1-有效，9-作废',
  `REMARK` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`),
  KEY `CODE` (`CODE`),
  KEY `NAME` (`NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

